import React from 'react'
import { useLocation } from 'react-router-dom'

function CartPage() {
  const location = useLocation()
  const {productId, counter} = location.state || {}
  console.log()
  return (
    <div>
      <h1>Cart Page</h1>
      {productId && (
        <div>
          <p>Product ID: {productId}</p>
          <p>amount: {counter}</p>
        </div>
      )}
    </div>
  )
}

export default CartPage
